import NavBar from "./Components/NavBar";
import { Switch, Route } from 'react-router-dom';
import Seminars from "./pages/Seminars";
import Users from "./pages/Users";
import Teams from "./pages/Teams";
import SeminarType from "./pages/SeminarType";
import SeminarDetails from "./pages/SeminarDetails";
import UserDetails from "./pages/UserDetails";
import './App.css'
import Footer from "./Components/Footer";
import Spiner from "./Components/Spiner";
import './Components/Spiner.css'
import { useState , useEffect} from 'react'


function App() {
  const [isLoading, setIsLoading] = useState(true)
  setTimeout( () => { setIsLoading(false) }, 500);

  return (
    <div>
      {!isLoading}
    <div className='wraper'>
       <NavBar ></NavBar>
       <Footer/>
       <Switch>
         <Route exact path='/'>

           <Seminars />
         </Route>
         <Route exact path='/users'>
           <Users />
         </Route>
         <Route exact path='/teams'>
           <Teams />
         </Route>
         <Route exact path='/seminartype'>
           <SeminarType />
         </Route>
         <Route exact path='/seminar/:id'>
           <SeminarDetails />
         </Route>
         <Route exact path='/users/:id/:first_name'>
           <UserDetails />
         </Route>
       </Switch>



    </div>

    </div>
  );
}

export default App;
